import React from "react";
import { Link } from "react-router-dom";

const ProfileActions = () => {
  return (
    <div className="btn-group mb-4" role="group">
      <a href="edit-profile.js" className="btn btn-light">
        <i class="fas fa-user-circle text-info mr-1">Edit Profile</i>
      </a>
      <a href="edit-profile.js" className="btn btn-light">
        <i class="fab fa-black-tie text-info mr-1">Add Experience</i>
      </a>
      <a href="edit-profile.js" className="btn btn-light">
        <i class="fas fa-graduation-cap text-info mr-1">Add Education</i>
      </a>
    </div>
  );
};
export default ProfileActions;
